class MyPoint 
{
	// define general system of dependencies
	
	x : double = radius * Math.Cos(theta*180/180); // x dependent on theta and radius
	y : double = radius * Math.Sin(theta*180/180); // y dependent on theta and radius
	z : double = 0.0;
											
