    {
        x_temp = EndPoint.X * v;
	p2_temp = Point.ByCartesianCoordinates( x_temp, EndPoint.Y, EndPoint.Z );
	new_trimmed_line = Line.ByStartPointEndPoint(StartPoint, p2_temp );
	return = new_trimmed_line;
